package assignmentOne;

public class OddNumbers {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		
		
		
		int num=50;
		System.out.println("Odd numbers between 1 to "+num);

		for(int i=0;i<=num;i++) {
			
			if(i%2 !=0) {
			System.out.print(i+" ");
			
			}
			
		}

	}

}
